import React from "react";
import { Menu, Image } from "semantic-ui-react";

function ProfileMenuItem(props) {
  if (localStorage.ranking < 1500) {
    localStorage.icon = "../images/rank icons/120px-Badge_1_Bronze.png";
  } else if (localStorage.ranking < 2000) {
    localStorage.icon = "../images/rank icons/120px-Badge_2_Silver.png";
  } else if (localStorage.ranking < 2500) {
    localStorage.icon = "../images/rank icons/120px-Badge_3_Gold.png";
  } else if (localStorage.ranking < 3000) {
    localStorage.icon = "../images/rank icons/120px-Badge_4_Platinum.png";
  } else if (localStorage.ranking < 3500) {
    localStorage.icon = "../images/rank icons/120px-Badge_5_Diamond.png";
  } else if (localStorage.ranking < 4000) {
    localStorage.icon = "../images/rank icons/120px-Badge_6_Master.png";
  } else {
    localStorage.icon = "../images/rank icons/120px-Badge_7_Grandmaster.png";
  }

  return (
    <Menu.Item>
      <Image src={require(localStorage.icon)} />
    </Menu.Item>
  );
}

export default ProfileMenuItem;
